    rxType(next){
        this.setRxModal(false)
        switch(next){
            case "torax":
                content = rxTorax
                this.getMsg("info","rx")
                this.props.sendModal(0, rx, "Rx Tórax", content)
                this.fillInformation("Rx Tórax",content)
                break;
            case "pelvis":
                content=""
                rx=[]
                
                switch(this.props.rxPelvis){
                case "1":
                    content=rxPelvis1_1
                    
                    rx.push({
                        src: rxPelvis1_2,  
                        altText: "rx pelvis",
                        caption: "rx pelvis"
                    })
                    this.fillrx()
                       break;

                case "2":
                    content=rxPelvis2_1
                    
                    rx.push({
                        src: rxPelvis2_2,  
                        altText: "rx pelvis",
                        caption: "rx pelvis"
                    })
                    this.fillrx()
                       break;
                case "3":
                    content=rxPelvis3_1
                    
                    rx.push({
                        src: rxPelvis3_2,  
                        altText: "rx pelvis",
                        caption: "rx pelvis"
                    })
                    this.fillrx()
                       break;
                case "4":
                    content=rxPelvis4_1
                    this.fillrx()
                       break;
                default:
                    content=rxPelvis1_1
                    this.fillrx()
                    
            }
                
                //this.getMsg("info","rx")
                //this.props.sendModal(0, rx, "Rx Pelvis", content)
                //this.fillInformation("Rx Pelvis",content)
                break;
            default:
                break;

        }
    }
